import React from 'react';  

const Member = () => {  
    return (  
        <div className="text-black p-5 w-3/4">  
            {/* block for banner */}  
            <div className='border-2 bg-slate-900 flex justify-between w-full text-white rounded-lg p-3'>  
                <div>Add member</div>  
                <div>Add membership</div>  
            </div>  
        </div>  
    );  
}  

export default Member;
